const WebFormOptions = ({ webFields, optionSelect }) =>
  webFields.map(field =>
    field.fieldName === optionSelect
      ? field.fieldOptions.forEach(option => (
          <option key={option.id} value={option.value}>
            {option.value}
          </option>
        ))
      : null
  );

export default WebFormOptions;
